        var mapLinkIdParts = ["teleport", "shop", "artifact_"]
        var mapLinks = []
        var y = 0, x = 0, row = [];
        for (var block of mapStr.split("")) {
            //console.log(x, y, all[block])
            row.push(block)
            if (x >= 121) {
                y++
                x = 0
                map.push(row)
                row = []
            } else {
                x++
            }
        }
        console.log(map)
        // Edit the so game don't crash
        map[0] = 'EEEEEEEEEEECCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCEEEEEEEEEEE'.split("")
        map[1] = 'EEEEEEEEEEECCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCEEEEEEEEEEE'.split("")
        map[2] = 'EEEEEEEEEEECCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCEEEEEEEEEEE'.split("")
        map[3] = 'EEEEEEEEEEECCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCEEEEEEEEEEE'.split("")
        map[4] = 'EEEEEEEEEEECCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCEEEEEEEEEEE'.split("")
        map[5] = 'EEEEEEEEEEEDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDEEEEEEEEEEE'.split("")
        map[6] = 'EEEEEEEEEEEAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAFAAAABAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAEEEEEEEEEEE'.split("")
        for (i in map[7]) {
            var col = map[7][i]
            if (![allReverse["none"], allReverse["soil"], allReverse["unbreakable"]].includes(col)) {
                map[7][i] = allReverse["soil"]
            }
        }
        // for (i = 0; i < 10; i++) map[7].push(allReverse["unbreakable"])
        // for (i = 0; i < 100; i++) map[7].push(allReverse["soil"])
        // for (i = 0; i < 12; i++) map[7].push(allReverse["unbreakable"])

        mapStr = ""
